import './App.css';
import { Link, Route, Routes, useNavigate } from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
              <Route path="/" element={<Home />} />
              <Route path="user" element={<User />}>
                {/* URL Params */}
                <Route
                  path=":id"
                  element={
                    <PrivateRoute>
                      <Suspense fallback="Loading...">
                        <Detail />
                      </Suspense>
                    </PrivateRoute>
                  }
                />
              </Route>
            </Routes>
    </>
  );
}

export default App;
